database/employee/ListEmployee.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Permission} from "../../abstract/Permission.sol";

import {Profile} from "../../struct/employee/EmployeeStruct.sol";

contract ListEmployee is Permission {
    Profile[] public list;

    constructor() Permission() {}

    event Add(Profile item);

    event Remove(Profile item);

    function add(Profile memory item) public onlyApproved {
        item.id = list.length;
        list.push(item);
        emit Add(item);
    }

    function at(uint256 index)
        public
        view
        onlyApproved
        returns (Profile memory)
    {
        return list[index];
    }

    function findIdByAddress(address value)
        public
        view
        onlyApproved
        returns (uint256)
    {
        for (uint256 i = 0; i < list.length; i++) {
            if (list[i].user == value) return list[i].id;
        }
        return 0;
    }

    function atAddress(address value)
        public
        view
        onlyApproved
        returns (Profile memory)
    {
        for (uint256 i = 0; i < list.length; i++) {
            if (list[i].user == value) return list[i];
        }
        return
            Profile(
                type(uint256).max,
                type(uint256).max,
                address(0),
                "",
                "",
                "",
                "",
                "",
                "",
                ""
            );
    }

    // setter //////////////////////////////////////////////////////////////////////////
    function setCategory(uint256 index, uint256 value) public onlyApproved {
        list[index].category = value;
    }

    function setId(uint256 index, uint256 value) public onlyApproved {
        list[index].id = value;
    }

    function setUser(uint256 index, address value) public onlyApproved {
        list[index].user = value;
    }

    function setName(uint256 index, string memory value) public onlyApproved {
        list[index].name = value;
    }

    function setPhone(uint256 index, string memory value) public onlyApproved {
        list[index].phone = value;
    }

    function setProfessional(uint256 index, string memory value)
        public
        onlyApproved
    {
        list[index].professional = value;
    }

    function setEmail(uint256 index, string memory value) public onlyApproved {
        list[index].email = value;
    }

    function setGithub(uint256 index, string memory value) public onlyApproved {
        list[index].github = value;
    }

    function setLinkedin(uint256 index, string memory value)
        public
        onlyApproved
    {
        list[index].linkedin = value;
    }

    function setSourceImage(uint256 index, string memory value)
        public
        onlyApproved
    {
        list[index].sourceImage = value;
    }
}

abstract/Permission.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.17 <0.9.0;

import {Context} from "@openzeppelin/contracts/utils/Context.sol";
import {Ownable} from "./Ownable.sol";

abstract contract Permission is Ownable {
    mapping(address => bool) private approved;

    constructor() Ownable() {}

    function approve() public onlyOwner {
        approved[_msgSender()] = true;
    }

    modifier onlyApproved() {
        _checkApproved();
        _;
    }

    function _checkApproved() internal view {
        require(
            approved[_msgSender()] || _msgSender() == owner(),
            "Permission: only approved"
        );
    }
}

